DROP TABLE IF EXISTS `optranslog`;
CREATE TABLE `optranslog` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id，自增长',
  `userid` varchar(50) DEFAULT NULL COMMENT '用户名',
  `username` varchar(60) DEFAULT NULL COMMENT '用户名称',
  `serv_type` varchar(12) DEFAULT NULL COMMENT '业务类型 recharge-充值 withdraw-提现 invest-投资',
  `busi_tp` varchar(8) DEFAULT NULL COMMENT '数据类型(PW11 充值 PWTX 提现 PWPC 转账\r\nPW13 预授权\r\nPWCF 预授权撤销\r\nPW03 划拨\r\nPW14 转账冻结\r\nPW15 划拨冻结\r\nPWDJ 冻结\r\nPWJD 解冻\r\nPW19 冻结付款到冻结\r\n)',
  `ext_tp` varchar(8) DEFAULT NULL COMMENT '扩展类型',
  `txn_date` date DEFAULT NULL COMMENT '交易日期',
  `txn_time` time DEFAULT NULL COMMENT '交易时分',
  `mchnt_ssn` varchar(30) DEFAULT NULL COMMENT '交易流水',
  `txn_amt` decimal(18,2) DEFAULT NULL COMMENT '交易金额',
  `txn_amt_suc` decimal(18,2) DEFAULT NULL COMMENT '成功交易金额',
  `contract_no` varchar(25) DEFAULT NULL COMMENT '合同号',
  `out_fuiou_acct_no` varchar(30) DEFAULT NULL COMMENT '出账用户虚拟账户',
  `out_cust_no` varchar(30) DEFAULT NULL COMMENT '出账用户名',
  `out_artif_nm` varchar(50) DEFAULT NULL COMMENT '出账用户名称',
  `in_fuiou_acct_no` varchar(30) DEFAULT NULL COMMENT '入账用户虚拟账户',
  `in_cust_no` varchar(30) DEFAULT NULL COMMENT '入账用户名',
  `in_artif_nm` varchar(50) DEFAULT NULL COMMENT '入账用户名称',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `txn_rsp_cd` varchar(10) DEFAULT NULL COMMENT '交易返回码',
  `rsp_cd_desc` varchar(155) DEFAULT NULL COMMENT '交易返回码描述',
  `sour_code` varchar(20) DEFAULT NULL COMMENT '数据来源编号',
  `checkflag` int(2) DEFAULT NULL COMMENT '核对数据是否正确 1-正确 0错误 2-未核对',
  `checkdesp` varchar(255) DEFAULT NULL COMMENT '核对结果描述',
  `temp1` varchar(60) DEFAULT NULL COMMENT '扩展字段1',
  `temp2` varchar(60) DEFAULT NULL COMMENT '扩展字段2',
  `temp3` varchar(60) DEFAULT NULL COMMENT '扩展字段3',
  `temp4` varchar(60) DEFAULT NULL COMMENT '扩展字段4',
  `temp5` varchar(60) DEFAULT NULL COMMENT '扩展字段5',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1444 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of optranslog
-- ----------------------------

